import { useState, useEffect } from "react";

// Type definition for prayer icons
interface PrayerIcons {
  fajr: string;
  dhuhr: string;
  asr: string;
  maghrib: string;
  isha: string;
}

// Base64 encoded prayer icons - Real SVG files uploaded by user
const PRAYER_ICONS_BASE64: PrayerIcons = {
  fajr: `data:image/svg+xml;base64,`,
  dhuhr: `data:image/svg+xml;base64,`,
  asr: `data:image/svg+xml;base64,`,
  maghrib: `data:image/svg+xml;base64,`,
  isha: `data:image/svg+xml;base64,`
};

// Hook to manage prayer icons
export const usePrayerIcons = () => {
  const [icons, setIcons] = useState<PrayerIcons | null>(null);
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    // Icons are already embedded as base64 strings
    setIcons(PRAYER_ICONS_BASE64);
  }, []);

  return { icons, loading };
};